## Steps to reproduce:
1. Use insiders version of the extension.
2. Opt-into the following experiments, by adding this line to settings:
`"python.experiments.optInto": ["DebugAdapterFactory - experiment", "PtvsdWheels37 - experiment"]`
3. Start a long running python script:
```py
import time
while True:
    print('ping')
    time.sleep(1)
```
4. [Bad case]Use this debug configuration to attach to process.
```js
{
  "name": "Attach pid",
  "type": "python",
  "request": "attach",
  "processId": "${command:pickProcess}",
  "pathMappings": [
    {
      "localRoot": "${workspaceFolder}",
      "remoteRoot": "."
    }
  ]
}
```
5. Try setting breakpoints inside the loop.
6. [Good case]Try the same thing with this configuration:
```js
{
  "name": "Attach pid",
  "type": "python",
  "request": "attach",
  "processId": "${command:pickProcess}"
},
```
